import React from "react";
import './TrackList.css';

const TrackList = ({tracks}) => {
    return (
        <div class="TrackList">
            {tracks.map((track) => (
                <div>
                    <h1>{track[0]}</h1>
                </div>
            ))}
        </div>
    )
}

export { TrackList };
